import React from 'react';
import './Name.scss';

export default function Name() {
  return (
    <div className='name'>
      <h1>Nassim Benattou</h1>
      <p>Créateur web fullstack passionné, alliant technique et créativité pour des expériences exceptionnelles.</p>
    </div>
  )
}
